INSERT INTO `block_content__body` VALUES ('basic',0,1,1,'en',0,'<p>Interactively transition multidisciplinary niche markets before seamless best practices. Rapidiously recaptiualize synergistic supply chains without client-centric materials. Appropriately optimize transparent experiences and diverse ideas.&nbsp;</p>\r\n','','basic_html'),('basic',0,4,4,'en',0,'<ul class=\"icons-list icons-list--bordered\">\r\n<li>\r\n<a href=\"http://www.facebook.com/morethan.just.themes/\"><i class=\"fa fa-facebook\"><span class=\"sr-only\">facebook</span></i></a>\r\n</li>\r\n<li>\r\n<a href=\"http://twitter.com/morethanthemes/\"><i class=\"fa fa-twitter\"><span class=\"sr-only\">twitter</span></i></a>\r\n</li>\r\n<li>\r\n<a href=\"https://plus.google.com/118354321025436191714/posts\"><i class=\"fa fa-google-plus\"><span class=\"sr-only\">google plus</span></i></a>\r\n</li>\r\n<li>\r\n<a href=\"http://www.linkedin.com/company/more-than-themes/\"><i class=\"fa fa-linkedin\"><span class=\"sr-only\">linkedin</span></i></a>\r\n</li>\r\n<li>\r\n<a href=\"http://www.youtube.com/morethanthemes/\"><i class=\"fa fa-youtube-play\"><span class=\"sr-only\">youtube</span></i></a>\r\n</li>\r\n<li>\r\n<a href=\"http://instagram.com/\"><i class=\"fa fa-instagram\"><span class=\"sr-only\">instagram</span></i></a>\r\n</li>\r\n<li>\r\n<a href=\"http://www.flickr.com/photos/morethanthemes/\"><i class=\"fa fa-flickr\"><span class=\"sr-only\">flickr</span></i></a>\r\n</li>\r\n<li>\r\n<a href=\"http://vimeo.com/morethanthemes\"><i class=\"fa fa-vimeo-square\"><span class=\"sr-only\">vimeo-square</span></i></a>\r\n</li>\r\n</ul>','','full_html'),('basic',0,5,5,'en',0,'<p>Objectively conceptualize high standards in intellectual capital vis-a-vis covalent meta-services. Dramatically synthesize just in time core competencies through interactive intellectual capital. Compellingly impact focused mindshare after fully researched testing procedures. Seamlessly benchmark enabled e-commerce with low-risk high-yield niches.</p>\r\n\r\n<p><a class=\"button\" href=\"#\">Get in touch</a></p>\r\n','','full_html'),('basic',0,7,7,'en',0,'<p>Corporate Lite is the free version of <a href=\"http://www.morethanthemes.com/?q=themes/toppluslite&amp;mt-referral=corporatelite\" target=\"_blank\">Top Lite</a> by <a href=\"http://www.morethanthemes.com/&amp;mt-referral=toppluslite\" target=\"_blank\"> More than Themes</a>.</p>\r\n\r\n<p>Corporate Lite is provided for everyone in the Drupal community to use and enjoy. You can use it for your personal or commercial projects, without any limitation. Although attribution is very much appreciated, it is not required.</p>\r\n\r\n<div class=\"more-link\"><a href=\"node/3\">Read more</a></div>\r\n','','full_html'),('basic',0,8,8,'en',0,'<p>Topplus Lite comes with a wealth of regions and classes, providing, among others, a rich multi-level footer where you can place lots of information about your site.</p>\r\n\r\n<p>Therefore, the important pages of your site, can always be just one click away for your visitor, regardless where in your site they are navigating.</p>\r\n','','full_html'),('basic',0,9,9,'en',0,'<p>Topplus Lite is a free theme, contributed to the Drupal Community by <a href=\"http://www.morethanthemes.com/&amp;mt-referral=toppluslite\" target=\"_blank\">More than Themes</a>.</p>\r\n','','full_html'),('basic',0,10,10,'en',0,'<div class=\"background-image-block__section field--mt-background-image-block\">\r\n<div class=\"background-image background-image--attachment-scroll\" style=\"background-image: url(https://mttprojects.s3.amazonaws.com/demo.drupalizing.com/topplus-lite/background-image-banner.jpg);\">&nbsp;</div>\r\n\r\n<div class=\"background-image-overlay region--light-typography region--black-background\" style=\"opacity: 0.65;\">&nbsp;</div>\r\n\r\n<div class=\"container region--light-typography region--black-background block\">\r\n<h2 class=\"title\">Our highlights, in short.</h2>\r\n\r\n<div class=\"highlights\">\r\n<p class=\"text-center bottom-spacing-medium\">Some times numbers do tell the truth. Perhaps, then, there’s no better<br class=\"hidden-xs\" />\r\nway to figure out more about us, than checking out these highlights.</p>\r\n\r\n<div class=\"row\">\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"highlight\">\r\n<div class=\"highlight-head\">1000000</div>\r\n\r\n<div class=\"highlight-body\">unique<br />\r\nvisitors</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"highlight\">\r\n<div class=\"highlight-head\">112000</div>\r\n\r\n<div class=\"highlight-body\">subscribers to<br />\r\nour newsletter</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"highlight\">\r\n<div class=\"highlight-head\">55000</div>\r\n\r\n<div class=\"highlight-body\">first time<br />\r\ncustomers</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-3 col-sm-6\">\r\n<div class=\"highlight\">\r\n<div class=\"highlight-head\">43000</div>\r\n\r\n<div class=\"highlight-body\">returning<br />\r\ncustomers</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n','','full_html'),('basic',0,11,11,'en',0,'<form action=\"#\" class=\"subscribe-form\">\r\n<div class=\"form-group\">\r\n<div class=\"form-item form-type-textfield\"><input class=\"form-text\" name=\"subscribe\" type=\"text\" value=\"Join our newsletter, get offers!\" /></div>\r\n\r\n<div class=\"form-actions\"><input class=\"form-submit\" id=\"subscribe-submit\" name=\"subscribe\" type=\"submit\" value=\"Sign up\" /></div>\r\n</div>\r\n</form>\r\n','','full_html'),('basic',0,12,12,'en',0,'<div class=\"row\">\r\n<div class=\"col-md-4\">\r\n<div class=\"logo-centered\"><a class=\"site-branding__logo\" href=\"#\" rel=\"home\" title=\"Home\"><img alt=\"Home\" src=\"http://mttprojects.s3.amazonaws.com/demo.morethanthemes.com/topplus/placeholders/logo-white.svg\" /> </a></div>\r\n\r\n<div class=\"text-center clearfix\">\r\n<div class=\"site-name site-branding__name\"><a href=\"#\" rel=\"home\" title=\"Home\">TOP+ Lite</a></div>\r\n\r\n<div class=\"site-slogan site-branding__slogan\">The free version of <a href=\"https://morethanthemes.com/themes/topplus?utm_source=topplus-lite-demo&amp;utm_medium=theme-settings&amp;utm_campaign=free-themes\" target=\"_blank\">Top+ Drupal 8 theme</a></div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"col-md-2 top-spacing-small text-center\">\r\n<ul class=\"icons-list icons-list--extra-large\">\r\n	<li><a href=\"#\"><i class=\"fa fa-facebook\"><span class=\"sr-only\">facebook</span></i></a></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-2 top-spacing-small text-center\">\r\n<ul class=\"icons-list icons-list--extra-large\">\r\n	<li><a href=\"#\"><i class=\"fa fa-twitter\"><span class=\"sr-only\">twitter</span></i></a></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-2 top-spacing-small text-center\">\r\n<ul class=\"icons-list icons-list--extra-large\">\r\n	<li><a href=\"#\"><i class=\"fa fa-linkedin\"><span class=\"sr-only\">linkedin</span></i></a></li>\r\n</ul>\r\n</div>\r\n\r\n<div class=\"col-md-2 top-spacing-small text-center\">\r\n<ul class=\"icons-list icons-list--extra-large\">\r\n	<li><a href=\"#\"><i class=\"fa fa-pinterest\"><span class=\"sr-only\">pinterest</span></i></a></li>\r\n</ul>\r\n</div>\r\n</div>\r\n','','full_html'),('basic',0,13,13,'en',0,'<ul class=\"icons-list icons-list--small text-right xs-text-center\">\r\n<li class=\"facebook\">\r\n<a href=\"http://www.facebook.com/morethan.just.themes/\"><i class=\"fa fa-facebook\"><span class=\"sr-only\">facebook</span></i></a>\r\n</li>\r\n<li class=\"twitter\">\r\n<a href=\"http://twitter.com/morethanthemes/\"><i class=\"fa fa-twitter\"><span class=\"sr-only\">twitter</span></i></a>\r\n</li>\r\n<li class=\"googleplus\">\r\n<a href=\"https://plus.google.com/118354321025436191714/posts\"><i class=\"fa fa-google-plus\"><span class=\"sr-only\">google plus</span></i></a>\r\n</li>                        \r\n<li class=\"linkedin\">\r\n<a href=\"http://w